import './index.scss'
import {DashboardOutlined,FormOutlined,TableOutlined,RobotOutlined,CheckCircleOutlined,WarningOutlined,UserOutlined,HighlightOutlined,MenuUnfoldOutlined,MenuFoldOutlined} from '@ant-design/icons';
import { Menu } from 'antd';
import {useState,useEffect} from 'react';
  
  function getItem(label, key, icon, children, type) {
    return {
      key,
      icon,
      children,
      label,
      type,
    };
  }
 
  

  
  function NavList(){
  //定义导航栏数据
  let [navLists,setNavLists]=useState([])
  //挂载完成，从后端获取数据
  useEffect(()=>{
    let lists= [
      {
        icon: <DashboardOutlined/>,
        id: 1,
        title: "Dashboard",
        url: "/Dashboard",
        children: [
          {
            icon: "",
            title: "分析",
            url: "/dashboard/fenxi",
            id:11
          },
          {
            icon: "",
            title: "监控",
            url: "/dashboard/jiankong",
            id:12
          },
          {
            icon: "",
            title: "工作台",
            url: "/dashboard/gongzuo",
            id:13
          },
        ],
      },
      {
        icon: <FormOutlined/>,
        id: 2,
        title: "表单页",
        url: "/form",
        children: [
          {
            icon: "",
            title: "基础表单",
            url: "/form/jichu",
            id:14
          },
          {
            icon: "",
            title: "分步表单",
            url: "/form/fenbu",
            id:15
          },
          {
            icon: "",
            title: "高级表单",
            url: "/dashboard/gaoji",
            id:16
          },
        ],
      },
      {
        icon: <TableOutlined />,
        id: 3,
        title: "列表页",
        url: "/table",
        children: [
          {
            icon: "",
            title: "搜索列表",
            url: "/table/sousuo",
            id:17,
            children: [
              {
                icon: "",
                title: "文章",
                url: "/table/sousuo/wenzhang",
                id:18
              },
              {
                icon: "",
                title: "项目",
                url: "/table/sousuo/xiangmu",
                id:19
              },
              {
                icon: "",
                title: "应用",
                url: "/table/sousuo/yingyong",
                id:20
              },
            ],
          },
          {
            icon: "",
            title: "查询表格",
            url: "/table/chaxun",
            id:21
          },
          {
            icon: "",
            title: "标准列表",
            url: "/table/biaozhun",
            id:23
          },
          {
            icon: "",
            title: "卡片列表",
            url: "/table/卡片",
            id:24
          },
        ],
      },
      {
        icon: <RobotOutlined />,
        id: 4,
        title: "详情页",
        url: "/xiangqing",
        children: [
          {
            icon: "",
            title: "基础详情页",
            url: "/xiangqing/jichuxiangqing",
            id:25
          },
          {
            icon: "",
            title: "高级详情页",
            url: "/xiangqing/gaojixiangqingye",
            id:26
          },
        ],
      },
      {
        icon: <CheckCircleOutlined />,
        id: 5,
        title: "结果页",
        url: "/jieguo",
        children: [
          {
            icon: "",
            title: "成功页",
            url: "/jieguo/success",
            id:27
          },
          {
            icon: "",
            title: "失败页",
            url: "/jieguo/err",
            id:28
          },
        ],
      },
      {
        icon: <WarningOutlined />,
        id: 6,
        title: "异常页",
        url: "/abnormal",
        children: [
          {
            icon: "",
            title: "403",
            url: "/abnormal/403",
            id:29
          },
          {
            icon: "",
            title: "404",
            url: "/abnormal/404",
            id:30
          },
          {
            icon: "",
            title: "500",
            url: "/abnormal/500",
            id:31
          },
        ],
      },
      {
        icon: <UserOutlined />,
        id: 7,
        title: "个人页",
        url: "/personage",
        children: [
          {
            icon: "",
            title: "个人中心",
            url: "/personage/usercenter",
            id:32
          },
          {
            icon: "",
            title: "个人设置",
            url: "/personage/userset",
          },
        ],
      },
      {
        icon: <HighlightOutlined />,
        id: 8,
        title: "图形编辑器",
        url: "/图形",
      },
    ];
    let datas=getLists(lists)
    setNavLists(datas)
  },[])
   function getLists(lists,arr=[]){
    console.log(lists);
      for(let i=0;i<lists.length;i++){
        if(lists[i].children && lists[i].children.length>0){
          arr[i] = getItem(lists[i].title, lists[i].id,lists[i].icon)
          arr[i].children = getLists(lists[i].children)
        }else{
          console.log(lists[i]);
          arr.push(getItem(lists[i].title, lists[i].id,lists[i].icon))
        }
      }
      return arr
   }
  const [collapsed, setCollapsed] = useState(false);
  const toggleCollapsed = () => {
    setCollapsed(!collapsed);
  };  
  return (
    <div className='left'>
      <Menu
        defaultSelectedKeys={['1']}
        defaultOpenKeys={['sub1']}
        mode="inline"
        inlineCollapsed={collapsed}
        items={navLists}
      />
      <div className='collapse'
        onClick={toggleCollapsed}
      >
        {collapsed ? <MenuUnfoldOutlined /> : <MenuFoldOutlined />}
      </div>
    </div>
  );
  };
  
  export default NavList;
